import axios from "axios";
import React, {Component} from "react";

class Obama extends Component {
    constructor(props) {
        super(props);
        this.state = {
            response: '',
            data: '',
            searchValue: '',
            users_subscription: [],
            selectedVal: "",
        }
    }

    componentDidMount() {
        let params = {
            "action": "wbsearchentities",
            "language": "en",
            "format": "json",
            "search": "Barack obama",
            "origin": "*",
            "limit": 5
        }

        let url = "https://www.wikidata.org/w/api.php";

        axios.get(url, {params: params}).then(result => {

            console.log('axios result ===> ', result);
            console.log(result.data.searchinfo.search);
            this.setState({response: result.data, search: result.data.search, searchValue: result.data.searchinfo.search})
        }).catch(err => console.log('axios error ===> ', err));

    }

    render() {
        return (
            <>

                <h3>The Last five presidents of united states of America</h3>
                <div>

                    <table>
                        <tr><td>{this.state.searchValue}</td>{this.state.search && this.state.search.map((element) => (
                            <>
                                <p>{element.id}</p>
                                <p>{element.display.description.value}</p>
                            </>
                        ))} <td></td></tr>
                    </table>
                    {/*{this.state.response.search.length}*/}



                </div>

            </>
        )
    }
}

export default Obama;
